
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>ZooMS Explorer</title>
    <style>
        :root {
            --primary: #2563eb;
            --bg: #f8fafc;
            --surface: #ffffff;
            --border: #e2e8f0;
            --text-main: #1e293b;
            --text-sub: #64748b;
        }

        body {
            margin: 0;
            padding: 0;
            font-family: 'Inter', -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif;
            background: var(--bg);
            color: var(--text-main);
            height: 100vh;
            display: flex;
            flex-direction: column;
        }

        /* Header */
        header {
            background: var(--surface);
            padding: 1rem 1.5rem;
            border-bottom: 1px solid var(--border);
            display: flex;
            justify-content: space-between;
            align-items: center;
            box-shadow: 0 1px 2px rgba(0,0,0,0.05);
            z-index: 10;
        }
        
        h1 { margin: 0; font-size: 1.25rem; font-weight: 600; }
        .subtitle { font-size: 0.85rem; color: var(--text-sub); }
        
        /* Main Layout */
        main {
            flex: 1;
            display: flex;
            flex-direction: column;
            overflow: hidden;
        }

        /* Top: Plot */
        #plot-container {
            flex: 6; /* 60% height */
            position: relative;
            background: var(--surface);
            border-bottom: 5px solid var(--border);
        }
        
        .plotly-graph-div {
            height: 100% !important;
            width: 100% !important;
        }

        /* Bottom: Table */
        #table-container {
            flex: 4;
            overflow: hidden;
            background: var(--surface);
            display: flex;
            flex-direction: column;
        }

        /* Table Styles */
        .table-toolbar {
            padding: 0.5rem 1rem;
            border-bottom: 1px solid var(--border);
            display: flex;
            gap: 1rem;
            align-items: center;
            background: #f1f5f9;
        }

        .search-box {
            padding: 0.4rem 0.8rem;
            border: 1px solid var(--border);
            border-radius: 4px;
            font-size: 0.9rem;
            width: 250px;
        }
        
        .help-text {
            font-size: 0.8rem;
            color: #666;
            margin-left: auto;
        }

        .table-scroll {
            flex: 1;
            overflow: auto;
        }

        table {
            width: 100%;
            border-collapse: collapse;
            font-size: 0.85rem;
        }

        th {
            position: sticky;
            top: 0;
            background: #f8fafc;
            text-align: left;
            padding: 0.75rem 1rem;
            font-weight: 600;
            color: var(--text-sub);
            border-bottom: 1px solid var(--border);
            cursor: pointer;
            user-select: none;
            z-index: 5;
        }
        
        th:hover { background: #f1f5f9; }

        td {
            padding: 0.6rem 1rem;
            border-bottom: 1px solid var(--border);
            cursor: pointer;
            transition: background 0.1s;
        }

        tr:hover td {
            background: #f8fafc;
        }

        /* Interactive States */
        tr.selected td {
            background: #e0e7ff; /* Light indigo */
            border-bottom-color: #c7d2fe;
        }

        .clickable-cell {
            color: var(--primary);
            font-weight: 500;
        }
        
        .clickable-cell:hover {
            text-decoration: underline;
        }
        
        .action-link {
            color: var(--text-sub);
            text-decoration: none;
            font-size: 0.8rem;
            padding: 2px 6px;
            border: 1px solid var(--border);
            border-radius: 3px;
        }
        
        .action-link:hover {
            background: var(--border);
            color: var(--text-main);
        }
        
        .mode-indicator {
            font-size: 0.85rem;
            color: var(--text-sub);
            background: #f1f5f9;
            padding: 0.2rem 0.6rem;
            border-radius: 1rem;
        }

        /* Spectrum Modal */
        #spectrum-modal {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0,0,0,0.7);
            z-index: 1000;
            justify-content: center;
            align-items: center;
        }
        #spectrum-modal.active {
            display: flex;
        }
        .modal-content {
            background: white;
            border-radius: 8px;
            width: 90%;
            max-width: 1200px;
            height: 80%;
            display: flex;
            flex-direction: column;
            overflow: hidden;
            box-shadow: 0 20px 60px rgba(0,0,0,0.3);
        }
        .modal-header {
            padding: 1rem 1.5rem;
            border-bottom: 1px solid var(--border);
            display: flex;
            justify-content: space-between;
            align-items: center;
        }
        .modal-header h2 {
            margin: 0;
            font-size: 1.1rem;
        }
        .modal-close {
            background: none;
            border: none;
            font-size: 1.5rem;
            cursor: pointer;
            color: var(--text-sub);
            padding: 0.25rem 0.5rem;
        }
        .modal-close:hover {
            color: var(--text-main);
        }
        #spectrum-plot {
            flex: 1;
            min-height: 0;
        }

    </style>
</head>

        </select>
    </div>
</header>

    async function showSpectrum(sampleId) {
        const modal = document.getElementById('spectrum-modal');
        const plotDiv = document.getElementById('spectrum-plot');
        const title = document.getElementById('spectrum-title');
        
        title.textContent = 'Loading...';
        modal.classList.add('active');
        
        const data = await loadSpectraData();
        if (!data) {
            title.textContent = 'Spectra data not available';
            plotDiv.innerHTML = '<p style="padding: 2rem; color: #666;">spectra_data.json not found. Run export_peaks_json.py to generate.</p>';
            return;
        }
        
        // Find sample (try exact match, then prefix match)
        let spectrum = data[sampleId];
        if (!spectrum) {
            // Try finding by partial match
            const key = Object.keys(data).find(k => k.includes(sampleId) || sampleId.includes(k));
            if (key) spectrum = data[key];
        }
        
        if (!spectrum) {
            title.textContent = `No spectrum data for ${sampleId}`;
            plotDiv.innerHTML = '<p style="padding: 2rem; color: #666;">Spectrum not found in dataset.</p>';
            return;
        }
        
        title.textContent = sampleId;
        
        // Create Plotly trace
        const trace = {
            x: spectrum.mz,
            y: spectrum.intensity,
            type: 'scatter',
            mode: 'lines',
            line: { color: '#2563eb', width: 1 },
            hovertemplate: 'm/z: %{x:.2f}<br>Intensity: %{y:,.0f}<extra></extra>'
        };
        
        // Add marker annotations
        const shapes = [];
        const annotations = [];
        if (spectrum.markers && spectrum.markers.length > 0) {
            spectrum.markers.forEach((m, i) => {
                // Vertical line at marker position
                shapes.push({
                    type: 'line',
                    x0: m.m, x1: m.m,
                    y0: 0, y1: m.i || spectrum.intensity[spectrum.mz.indexOf(m.m)] || 1000,
                    line: { color: '#dc2626', width: 1, dash: 'dot' }
                });
                // Label (only for high intensity or every 5th to avoid crowding)
                if (i % 3 === 0 || m.i > 5000) {
                    annotations.push({
                        x: m.m,
                        y: m.i || 1000,
                        text: m.g || m.l.split('_')[0],
                        showarrow: false,
                        font: { size: 9, color: '#dc2626' },
                        yshift: 10
                    });
                }
            });
        }
        
        const layout = {
            margin: { l: 60, r: 20, t: 40, b: 50 },
            xaxis: { title: 'm/z', range: [800, 3500] },
            yaxis: { title: 'Intensity' },
            shapes: shapes,
            annotations: annotations,
            hovermode: 'closest'
        };
        
        Plotly.newPlot(plotDiv, [trace], layout, { responsive: true });
    }

                continuous.push({key, label: enc.label});

        let html = '<optgroup label="Categorical">';
        categorical.forEach(item => {

            html += `<option value="${item.key}" ${selected}>${item.label}</option>`;
        });
        html += '</optgroup>';
        
        html += '<optgroup label="Continuous">';
        continuous.forEach(item => {
            const selected = item.key === currentParam ? 'selected' : '';
            html += `<option value="${item.key}" ${selected}>${item.label}</option>`;
        });
        html += '</optgroup>';
        
        colorSelect.innerHTML = html;

            specBtn.title = 'View interactive spectrum';
            specBtn.onclick = (e) => {
                e.stopPropagation();
                showSpectrum(row.id);
            };
            actionTd.appendChild(specBtn);
            
            tr.appendChild(actionTd);
            
            // Row selection handler
            tr.onclick = () => {
                highlightRow(tr, row.id);
                highlightPointInPlot(row.id);
                showSpectrum(row.id);
            };
            
            fragment.appendChild(tr);
        });
        
        tableBody.innerHTML = '';
        tableBody.appendChild(fragment);
    }
    
    // --- Interactions ---

    function recolorPlot(param) {
        if (!encodings[param]) return;
        
        currentParam = param;
        // Update dropdown if called from table click
        if (colorSelect && colorSelect.value !== param) {
            colorSelect.value = param;
        }
        
        const encoding = encodings[param];
        
        let update = {
            'marker.color': [encoding.values],
            'marker.colorscale': [encoding.colorscale],
            'marker.colorbar.title': encoding.label
        };
        
        Plotly.restyle(plotDiv, update, [0]);
    }
    
    function highlightPointInPlot(id) {
        const index = allIds.indexOf(id);
        if (index === -1) return;
        
        const x = plotDiv.data[0].x[index];
        const y = plotDiv.data[0].y[index];
        const z = plotDiv.data[0].z[index];
        
        // Use annotation to highlight
        const layoutUpdate = {
            'scene.annotations': [{
                x: x, y: y, z: z,
                text: id,
                showarrow: true,
                arrowhead: 1,
                ax: 0, ay: -50,
                bgcolor: 'rgba(255, 255, 255, 0.9)',
                bordercolor: '#000',
                borderwidth: 1,
                font: {size: 12}
            }]
        };
        
        Plotly.relayout(plotDiv, layoutUpdate);
    }

    function highlightRow(tr, id) {
        document.querySelectorAll('tr.selected').forEach(el => el.classList.remove('selected'));
        if (tr) {
            tr.classList.add('selected');
            tr.scrollIntoView({behavior: 'smooth', block: 'nearest'});
        }
    }

    function setupPlotEvents() {
        plotDiv.on('plotly_click', function(data) {
            if (!data.points || data.points.length === 0) return;
            
            const pointIndex = data.points[0].pointNumber;
            const id = allIds[pointIndex];
            
            // Find row
            let targetRow = null;
            const rows = document.querySelectorAll('#data-table tbody tr');
            for (let row of rows) {
                if (row.dataset.id === id) {
                    targetRow = row;
                    break;
                }
            }
            
            if (targetRow) {
                highlightRow(targetRow, id);
            }

            // Handle URL opening
            const rowData = tableData.find(d => d.id === id);
            
            if (rowData) {
                if (window.event && window.event.shiftKey && rowData.Quality_Image && rowData.Quality_Image !== 'nan') {
                     window.open(rowData.Quality_Image, '_blank');
                } else if (rowData.Spectrum_Image && rowData.Spectrum_Image !== 'nan') {
                     // Optional: Uncomment to auto-open on plot click
                     // window.open(rowData.Spectrum_Image, '_blank');
                }
            }
        });
    }

    // --- Search ---
    searchInput.addEventListener('input', (e) => {
        const term = e.target.value.toLowerCase();
        const rows = document.querySelectorAll('#data-table tbody tr');
        
        rows.forEach(row => {
            const text = row.innerText.toLowerCase();
            if (text.includes(term)) {
                row.style.display = '';
            } else {
                row.style.display = 'none';
            }
        });
    });

    // Boot
    init();

</script>

</body>
</html>
